function approve(address to, uint256 tokenId) public payable {
    // Fetch the current owner of the token.
    address tokenOwner = ownerOf(tokenId);

    // Revert if the caller is neither the owner nor approved operator.
    if (msg.sender != tokenOwner && !isApprovedForAll(tokenOwner, msg.sender)) {
        revert ApprovalCallerNotOwnerNorApproved();
    }

    // Update the single‐token approval mapping.
    _tokenApprovals[tokenId] = to;

    // Emit the standard ERC-721 approval event.
    emit Approval(tokenOwner, to, tokenId);
}

